import React from "react";
import Header from "../../components/Header";
import { Col, Row, Container } from "../../components/Grid";
import Image from "react-bootstrap/Image";
import "./style.css"
import profile from "../../documents/profile_picture_2.jpg";

function About() {
    return (
        <div>
            <Header />
            <Container>
                <Row>
                    <Col size="md-6">
                        <Image src={profile} alt="Headshot" className="about-image" thumbnail/>
                    </Col>
                    <Col size="md-6">
                        <p>I am a full-stack web developer based in Washington, D.C. I started my career as a
                        Audio/Visual
                        specialist for the Smithsonian Institution in Washington, D.C. From there, I moved into the
                        intergrated AV
                        system industry working as a service technician. This role set me up for my knowledge and
                        experience in the
                        IT/programming industry.</p>
                    </Col>
                </Row>
            </Container>
            {/* <Footer /> */}
        </div>
    )
}

export default About;
